(2285, 33, 'A 17-year-old boy has a laceration in the superior aspect of his upper eyelid and orbital fat  is present in the wound.  Which of the following structures is most likely to be INTACT?', 'Aponeurosis of levator palpebrae superioris', 'Orbicularis oculi', 'Orbital septum', 'Palpebral skin', 'Tela subcutanea', 'A', 'SBA', '2004-09-07', 1, 11),
(2286, 34, 'A 37-year-old woman has a benign tumor in her parotid gland which is resected (removed).   Which of the following is the most likely complication of the surgery?', 'Absence of taste on posterior third of tongue', 'Complete ptosis', 'Dilated pupil', 'Drooling from corner of mouth', 'Inability to elevate palate', 'D', 'SBA', '2004-09-07', 1, 13),
(2287, 35, 'An 80-year-old woman with a 65-year history of using chewing tobacco has a 1 cm malignant lesion on the upper lip near  the labial commissure.  Malignant cells are most likely to FIRST appear in which of the following groups of lymph nodes?', 'Occipital', 'Parotid', 'Submandibular', 'Submental', 'Superficial cervical', 'C', 'SBA', '2004-09-07', 1, 13),
(2288, 36, 'The parotid duct normally pierces  which of the following muscles?', 'Buccinator', 'Lateral pterygoid', 'Masseter', 'Medial pterygoid', 'Orbicularis oris', 'A', 'SBA', '2004-09-07', 1, 13),
(2289, 37, 'Which of the following develop (totally  or in part) from the optic cup?', 'Choroid', 'Cornea', 'Iris', 'Lens', 'Sclera', 'C', 'SBA', '2004-09-07', 1, 12),
(2290, 38, 'The layer of rods and cones in the retina is analogous  to which structure(s) in the spinal cord?', 'Dorsal horn', 'Ependymal cells', 'Oligodendrocytes', 'Ventral horn', 'White matter', 'B', 'SBA', '2004-09-07', 1, 12),
(2291, 39, 'A 2-day-old newborn girl has an irregular “key-hole”-shaped  pupil.  This condition is called', 'coloboma.', 'congenital cataract.', 'congenital detached retina.', 'papilledema.', 'persistent pupillary membrane.', 'A', 'SBA', '2004-09-07', 1, 12),
(2292, 40, 'Which of the following structures is located  approximately at the level of the C6 vertebra?', 'Cricoid cartilage', 'Hyoid bone', 'Isthmus of the thyroid gland', 'Tendon of digastric muscle', 'Third tracheal ring', 'A', 'SBA', '2004-09-07', 2, 16),
(2293, 41, 'All of the following nerves are branches  of the cervical plexus EXCEPT for the', 'ansa cervicalis.', 'great auricular.', 'greater occipital.', 'supraclavicular.', 'transverse cervical.', 'C', 'SBA', '2004-09-07', 2, 16),
(2294, 42, 'A pediatrician draws blood from the midpoint of the external jugular vein of a severely dehydrated one-month-old  boy.  During the procedure, the needle is most likely to penetrate which of the following structures?', 'Alar fascia', 'Carotid sheath', 'Investing cervical fascia', 'Platysma', 'Prevertebral fascia', 'D', 'SBA', '2004-09-07', 2, 16),
(2295, 43, 'Which of the following muscles  can elevate the hyoid bone?', 'Omohyoid', 'Sternohyoid', 'Sternothyroid', 'Stylohyoid', 'Thyrohyoid', 'D', 'SBA', '2004-09-07', 2, 17),
(2296, 44, 'During the insertion of a central line into the jugular vein of a 57-year-old woman, the sympathetic trunk is injured  between the middle and inferior ganglia.  Which of the following post surgical complications is most likely?', 'Dilated pupil', 'Flushed (red) face', 'Inability to clench teeth tightly', 'Inability to smile', 'Irritated cornea', 'B', 'SBA', '2004-09-07', 2, 16),
(2297, 45, 'Which of the following is normally a direct  or indirect branch of the subclavian artery?', 'Ascending pharyngeal', 'Lingual', 'Occipital', 'Superior thyroid', 'Vertebral', 'E', 'SBA', '2004-09-07', 2, 17),
(2298, 46, 'A 65-year-old man has an atherosclerotic blockage of the maxillary artery immediately medial to the lateral  pterygoid muscle.  The blood flow is most likely to be impaired in which of the following arteries?', 'Anterior ethmoidal', 'Inferior alveolar', 'Infraorbital', 'Middle meningeal', 'Superior labial', 'C', 'SBA', '2004-09-07', 1, 15),
(2299, 47, 'A petulant 7-year-old child continually “juts his jaw” (protracts his mandible).   Which of the following muscles is contracting to the greatest degree?', 'Buccinator', 'Lateral pterygoid', 'Masseter', 'Medial pterygoid', 'Temporalis', 'B', 'SBA', '2004-09-07', 1, 15),
(2300, 48, 'Which of the following structures passes between  the middle and inferior pharyngeal constrictors?', 'External branch of superior laryngeal nerve', 'Levator veli palatini', 'Recurrent laryngeal nerve', 'Stylopharyngeus', 'Superior laryngeal artery', 'E', 'SBA', '2004-09-07', 2, 18),
(2301, 49, 'An abscess has developed in the neck of a 72-year-old woman immediately posterior to the alar fascia  in the midline.  Which of the following fascial layers limits the spread of the abscess posteriorly?', 'Buccopharyngeal fascia', 'Carotid sheath', 'Investing cervical fascia', 'Pharyngobasilar fascia', 'Prevertebral fascia', 'E', 'SBA', '2004-09-07', 2, 17),
(2302, 50, 'Which of the following is a feature  of the pharyngeal isthmus?', 'Lateral glossoepiglottic folds', 'Median glossoepiglottic fold', 'Palatoglossal arch', 'Sulcus terminalis of tongue', 'Uvula', 'E', 'SBA', '2004-09-07', 2, 18),
(2303, 51, 'During an attempt to anesthetize the mandibular division of the trigeminal nerve, the inferior alveolar nerve is injured immediately inferior  to the foramen ovale.  Three weeks after the procedure, the function of which of the following muscles is m', 'Anterior belly of digastric', 'Buccinator', 'Palatoglossus', 'Stylohyoid', 'Thyrohyoid', 'A', 'SBA', '2004-09-07', 1, 15),
(2304, 52, 'A 2-day-old newborn boy has a left unilateral cleft lip.  Which  of the following prominences have failed to fuse normally?', 'Mandibular and maxillary', 'Maxillary and lateral nasal', 'Maxillary and medial nasal', 'Medial nasal and lateral nasal', 'Medial nasal prominences', 'C', 'SBA', '2004-09-07', 2, 19),
(2305, 53, 'Which of the following structures is derived from  the neural crest cells of a pharyngeal arch?', 'Cricoid cartilage', 'Masseter', 'Orbicularis oris', 'Superior parathyroid gland', 'Thyroid gland', 'A', 'SBA', '2004-09-07', 2, 19),
(2306, 54, 'A 23-year-old man has a 2 cm painless swelling on the left side of his neck immediately anterior to the sternocleidomastoid.   The swelling is not open to the skin or the pharynx.  This is most likely an abnormal persistence of the', 'cervical sinus.', 'first pharyngeal groove.', 'first pharyngeal pouch.', 'second pharyngeal pouch.', 'thyroglossal duct.', 'A', 'SBA', '2004-09-07', 2, 19),
(2307, 55, 'The cell bodies of sympathetic nerve  fibers in the head are located in the', 'collateral ganglia.', 'intermediolateral cell column.', 'superior cervical ganglion.', 'T1 ganglion of sympathetic trunk.', 'terminal ganglia.', 'C', 'SBA', '2004-09-07', 1, 14),
(2308, 1, 'A 75-year-old man with atherosclerotic disease has a 95% blockage of the right external carotid artery.  Blood flow  to the right side of the nasal septum is LEAST likely to be impaired in branches of which of the following arteries?', 'Anterior ethmoidal', 'Descending palatine', 'Greater palatine', 'Sphenopalatine', 'Superior labial', 'A', 'SBA', '2004-10-29', 2, 20),
(2309, 2, 'A 37-year-old man has chronic sinusitis in a sphenoid sinus.  During surgery for his condition, the nerve  of the pterygoid canal is inadvertently injured.  Which of the following complications is most likely?', 'Impaired secretion of the lacrimal gland', 'Impaired general sensation in mucosa of nasal septum', 'Impaired general sensation in mucosa of hard palate', 'Ptosis', 'Vasoconstriction in mucosa of nasal septum', 'A', 'SBA', '2004-10-29', 2, 20),
(2310, 3, 'Which of the following is most likely  to be present in a two-day old neonate?', 'Half of the adult number of alveoli in the lung', 'Mastoid process', 'Maxillary sinus', 'Patent umbilical artery at umbilicus', 'Sphenoid sinus', 'C', 'SBA', '2004-10-29', 2, 20);
