(2311, 4, 'Which of the following bones form  the floor of the nasal cavity?', 'Maxilla and ethmoid', 'Maxilla and palatine', 'Palatine and ethmoid', 'Sphenoid and ethmoid', 'Sphenoid and palatine', 'B', 'SBA', '2004-10-29', 2, 20),
(2312, 5, 'A four-year-old boy says he has a “sore throat”, but no pathology is noted in his pharynx.   If this pain is referred from another site, which of the following sites is most likely?', 'Mandibular teeth', 'Nasal cavity', 'Orbit', 'Temporomandibular joint', 'Tympanic cavity', 'E', 'SBA', '2004-10-29', 2, 23),
(2313, 6, 'A 45-year-old man is injured in an automobile collision, and a large quantity of pulsatile arterial blood leaks from a  ruptured tympanic membrane.  Which of the following bony walls of the tympanic cavity has most likely been fractured?', 'Anterior', 'Inferior', 'Medial', 'Posterior', 'Superior', 'A', 'SBA', '2004-10-29', 2, 22),
(2314, 7, 'Which of the following structures is  located in the epitympanic recess?', 'Chorda tympani nerve', 'Head of malleus', 'Pyramid', 'Stapes', 'Tendon of tensor tympani muscle', 'B', 'SBA', '2004-10-29', 2, 22),
