(2316, 9, 'The lateral semicircular duct of the internal ear is  derived from which of the following embryonic origins?', 'Endoderm', 'Mesoderm', 'Neural crest', 'Neural tube', 'Surface ectoderm', 'E', 'SBA', '2004-10-29', 2, 23),
(2317, 10, 'All of the following are derived from the  first pharyngeal pouch EXCEPT for the', 'epithelium of auditory tube.', 'epithelium of epitympanic recess.', 'malleus.', 'epithelium of mastoid antrum.', 'medial surface of tympanic membrane.', 'C', 'SBA', '2004-10-29', 2, 23),
(2318, 11, 'Which of the following structures is oriented  most perpendicularly to the petrous ridge?', 'Auditory tube', 'Belly of tensor tympani muscle', 'Facial nerve in internal acoustic meatus', 'Greater petrosal nerve', 'Posterior semicircular canal', 'C', 'SBA', '2004-10-29', 2, 22),
(2319, 12, 'How many MAXILLARY teeth are present  in a complete set of deciduous teeth?', '5', '8', '10', '16', '20', 'C', 'SBA', '2004-10-29', 2, 24),
(2320, 13, 'A dentist administers an injection for anesthesia of the mandibular teeth in the region of the lingula and inadvertently  injures the lingual nerve at this site.  All of the following are likely results of the injury EXCEPT for impaired', 'general sensation on tip of tongue.', 'secretion from sublingual gland.', 'secretion from submandibular gland.', 'taste on tip of tongue.', 'taste on vallate papillae.', 'E', 'SBA', '2004-10-29', 2, 24),
(2321, 14, 'A 17-year-old girl has an enlarged submental lymph node.   Pathology at which of the following sites is most likely?', 'Hard palate', 'Lingual tonsil', 'Mandibular incisor', 'Maxillary canine', 'Philtrum of lip', 'C', 'SBA', '2004-10-29', 2, 24),
(2322, 15, 'Which of the following structures lies  medial to the hyoglossus muscle?', 'Hypoglossal nerve', 'Lingual artery', 'Lingual nerve', 'Sublingual gland', 'Submandibular duct', 'B', 'SBA', '2004-10-29', 2, 24),
(2323, 16, 'A 76-year-old woman has cancer of the upper lobe of the left lung.  During resection of the tumor, the recurrent  laryngeal nerve is inadvertently injured.  Which of the following is most likely to be impaired?', 'Ability to raise pitch of voice', 'General sensation in mucosa of infraglottic space', 'General sensation in mucosa of laryngeal ventricle', 'General sensation in mucosa of laryngeal vestibule', 'General sensation in mucosa of vestibular fold', 'B', 'SBA', '2004-10-29', 2, 21),
(2324, 17, 'The arytenoid cartilage articulates with which  of the following structures in a synovial joint?', 'Cricoid cartilage', 'Epiglottis', 'First tracheal ring', 'Hyoid bone', 'Thyroid cartilage', 'A', 'SBA', '2004-10-29', 2, 21),
(2325, 18, 'The cell bodies of efferent fibers to the skeletal  muscle of the cricothyroid muscle are located in the', 'dorsal motor nucleus of the vagus.', 'inferior ganglion of the vagus.', 'nucleus ambiguus.', 'sympathetic trunk.', 'ventral horn of the C4 spinal cord.', 'C', 'SBA', '2004-10-29', 2, 21),
(2326, 19, 'An 80-year-old man has a biopsy of a deep cervical lymph node and an artery is inadvertently injured.  If  the injury impairs blood supply to the larynx, which of the following arteries was most likely damaged?', 'Costocervical trunk', 'Internal thoracic', 'Thoracoacromial', 'Thyrocervical trunk', 'Vertebral', 'D', 'SBA', '2004-10-29', 2, 21),
(2327, 20, 'A 59-year-old woman with breast cancer has surgical exploration of her right axillary lymph nodes.  After the procedure, she has difficulty brushing  her hair and the medial edge of her right scapula protrudes from the chest wall.  Which of the follo', 'Ansa cervicalis', 'Lateral pectoral', 'Long thoracic', 'Spinal accessory', 'Thoracodorsal', 'C', 'SBA', '2004-10-29', 3, 25),
(2328, 21, 'A carcinoma in the superomedial quadrant of the left breast of a 45-year-old woman has invaded the retromammary space and  “fixed” the breast to the thoracic wall.  The fascia of which of the following muscles is most likely to be affected first?', 'External intercostal', 'External oblique', 'Pectoralis major', 'Pectoralis minor', 'Serratus anterior', 'C', 'SBA', '2004-10-29', 3, 25),
