(2331, 24, 'An 18-year-old girl is in an automobile collision and has blood in the right pleural cavity.  In the seated position,  the inferior border of the pooled blood will be located at the level of which rib in the midaxillary line?', '4', '6', '8', '10', '12', 'D', 'SBA', '2004-10-29', 3, 31),
(2332, 25, 'A man is stabbed with an ice-pick in the left fifth intercostal space immediately  adjacent to the sternum.  Which of the following layers will be pierced FIRST?', 'Costal pleura', 'Fibrous pericardium', 'Mediastinal pleura', 'Parietal layer of serous pericardium', 'Visceral pleura', 'B', 'SBA', '2004-10-29', 3, 26),
(2333, 26, 'The movement which is primarily responsible for the increase in the transverse  (side to side) dimension of the thorax during inspiration is the', 'bucket-handle movement of the lower ribs.', 'contraction of the diaphragm.', 'extension of the thoracic vertebral column.', 'movement at the manubriosternal joint.', 'pump-handle movement of the upper ribs.', 'A', 'SBA', '2004-10-29', 3, 25),
(2334, 27, 'Which of the following structures is located in BOTH the  superior mediastinum and the posterior mediastinum?', 'Ascending aorta', 'Phrenic nerve', 'Recurrent branch of right vagus nerve', 'Sympathetic trunk', 'Thoracic duct', 'E', 'SBA', '2004-10-29', 3, 27),
(2335, 28, 'The posterior boundary of the  anterior mediastinum is the', 'manubrium.', 'pericardial sac.', 'T1 to T4 thoracic vertebral bodies.', 'T5 to T12 thoracic vertebral bodies.', 'transversus thoracis muscle.', 'B', 'SBA', '2004-10-29', 3, 27),
(2336, 29, 'Which of the following structures  NORMALLY compresses the esophagus?', 'Arch of the aorta', 'Left atrium of the heart', 'Right atrium of the heart', 'Right primary bronchus', 'Thyroid cartilage', 'A', 'SBA', '2004-10-29', 3, 27),
(2337, 30, 'Lymph from all of the following structures is normally  delivered to the thoracic duct EXCEPT for the', 'esophagus.', 'right kidney.', 'right breast.', 'spleen.', 'stomach.', 'C', 'SBA', '2004-10-29', 3, 27),
(2338, 31, 'A 57-year-old man with atherosclerotic disease has an infarct of the septal papillary muscle.   Damage to this muscle is most likely to impair the function of which of the following valves?', 'Aortic', 'Inferior vena cava', 'Mitral', 'Pulmonary', 'Tricuspid', 'E', 'SBA', '2004-10-29', 3, 28),
