(2340, 33, 'During a coronary bypass procedure, the surgeon passes his index finger into the transverse  sinus from the left side.  On this side, which structure lies anterior to his finger?', 'Ascending aorta', 'Coronary sinus', 'Left atrium', 'Pulmonary trunk', 'Superior vena cava', 'D', 'SBA', '2004-10-29', 3, 28),
(2341, 34, 'Which of the following veins drains  DIRECTLY into the left atrium?', 'Anterior cardiac vein', 'Great cardiac vein', 'Least cardiac (Thebesian) vein', 'Middle cardiac vein', 'Small cardiac vein', 'C', 'SBA', '2004-10-29', 3, 28),
(2342, 35, 'Which of the following is a derivative  of the sixth aortic arch on the left?', 'Arch of the aorta', 'Ductus arteriosus', 'Left maxillary artery', 'Left common carotid artery', 'Proximal portion of left subclavian artery', 'B', 'SBA', '2004-10-29', 3, 30),
(2343, 36, 'Prior to birth, blood in which of the following vessels is  most likely to have the highest concentration of oxygen?', 'Ductus arteriosus', 'Inferior vena cava where it enters right atrium', 'Left common carotid artery', 'Pulmonary vein', 'Superior vena cava where it enters right atrium', 'B', 'SBA', '2004-10-29', 3, 30),
(2344, 37, 'The derivative of the sinus venosus  on the right side is a portion of the', 'great cardiac vein.', 'left atrium.', 'left ventricle.', 'right atrium.', 'right ventricle.', 'D', 'SBA', '2004-10-29', 3, 29),
(2345, 38, 'The septum secundum is underdeveloped (too small) in a male neonate  who is not cyanotic.  His condition can best be described as a(an)', 'endocardial cushion defect.', 'ostium primum defect.', 'ostium secundum defect.', 'transposition of the great vessels.', 'ventricular septal defect.', 'C', 'SBA', '2004-10-29', 3, 29),
(2346, 39, 'A 10-day-old girl has bluish-hued nailbeds and lips and is diagnosed with  tetralogy of Fallot.  Which of the following is most likely to be present?', 'Left ventricular hypertrophy', 'Ostium primum defect', 'Ostium secundum defect', 'Stenotic (narrowed) ascending aorta', 'Ventricular septal defect', 'E', 'SBA', '2004-10-29', 3, 29),
(2347, 40, 'The adult remnant of the umbilical vein is located  in which of the following ligaments in the adult?', 'Falciform', 'Gastrosplenic', 'Hepatoduodenal', 'Hepatogastric', 'Lienorenal', 'A', 'SBA', '2004-10-29', 3, 30),
(2348, 41, 'The first organ system to develop a FUNCTIONAL  status in the embryo is the', 'cardiovascular.', 'gastrointestinal.', 'nervous.', 'respiratory.', 'urinary.', 'A', 'SBA', '2004-10-29', 3, 29),
(2349, 42, 'A 2-year-old boy places a small plastic Lego in his mouth and aspirates it.  He coughs violently for 90 seconds and then the coughing subsides.   The child is taken to the emergency room and breath sounds are determined to be reduced on the right bac', 'epiglottic vallecula.', 'esophagus.', 'lower lobe of the right lung.', 'middle lobe of the right lung.', 'upper lobe of the right lung.', 'C', 'SBA', '2004-10-29', 3, 31),
(2350, 43, 'A mesothelioma has developed in the visceral pleura of the lingula.  If the malignancy has NOT transversed the  pleural cavity, to which of the following groups of lymph nodes is the malignancy most likely to spread FIRST?', 'Axillary', 'Bronchopulmonary', 'Parasternal', 'Pulmonary', 'Tracheobronchial', 'D', 'SBA', '2004-10-29', 3, 31),
(2351, 44, 'A 90-year-old man has a malignancy in the right primary bronchus at the hilum of the lung.  If the  malignancy spreads anteriorly, which of the following structures is most likely to be invaded NEXT?', 'Inferior pulmonary vein', 'Phrenic nerve', 'Pulmonary artery', 'Superior pulmonary vein', 'Vagus nerve', 'C', 'SBA', '2004-10-29', 3, 31),
(2352, 45, 'Which of the following nervous structures contains  sympathetic preganglionic efferent fibers?', 'Cardiac plexus', 'Gray ramus communicans', 'Greater splanchnic nerve', 'Phrenic nerve', 'Recurrent branch of the vagus', 'C', 'SBA', '2004-10-29', 3, 27),
(2353, 46, 'The peritoneum which invests the wall  of the jejunum is derived from', 'endoderm.', 'paraxial mesoderm.', 'somatic mesoderm.', 'splanchnic mesoderm.', 'surface ectoderm.', 'D', 'SBA', '2004-10-29', 3, 32),
(2354, 47, 'A newborn boy is in respiratory distress.  Upon examination, he has bowel sounds in his left thorax  and the trachea is deviated to the right.  The most likely diagnosis for his condition is', 'double aortic arch.', 'esophageal atresia.', 'posterolateral defect of the diaphragm.', 'sucking pneumothorax on the right.', 'tension pneumothorax on the left.', 'C', 'SBA', '2004-10-29', 3, 32),
