(2358, 51, 'A 67-year-old woman has a sarcoma in the right rectus abdominis muscle two centimeters superior to the umbilicus.  If  the mass grows posteriorly into the rectus sheath, which of the following layers is most likely to be invaded FIRST?', 'External oblique aponeurosis', 'Internal oblique aponeurosis', 'Parietal peritoneum', 'Transversalis fascia', 'Transversus abdominis aponeurosis', 'B', 'SBA', '2004-10-29', 3, 33),
(2359, 52, 'The dermatome of the skin immediately  surrounding the umbilicus is', 'T4.', 'T6.', 'T8.', 'T10.', 'T12.', 'D', 'SBA', '2004-10-29', 3, 33),
(2360, 53, 'Which of the following structures is formed from  the ventral mesentery of the primitive gut?', 'Gastrosplenic ligament', 'Greater omentum', 'Hepatoduodenal ligament', 'Mesentery of the jejunum', 'Mesentery of the transverse colon', 'C', 'SBA', '2004-10-29', 4, 34),
(2361, 54, 'Which of the following structures receives its major  blood supply from branches of the celiac trunk?', 'Cecum', 'First part of the duodenum', 'Jejunum', 'Sigmoid colon', 'Transverse colon', 'B', 'SBA', '2004-10-29', 4, 34),
(2362, 55, 'A 57-year-old man has an ulcer in the posterior wall of his stomach which perforates.   In which of the following spaces will the escaped stomach fluid accumulate?', 'Costodiaphragmatic recess', 'Greater sac to the left of the radix', 'Greater sac to the right of the radix', 'Oblique sinus', 'Omental bursa', 'E', 'SBA', '2004-10-29', 4, 34),
