(2364, 2, 'During a surgical procedure, the three teniae coli of a portion of intestine are observed to converge at a point  on the bowel.  Which of the following structures is most likely to be located at the site of convergence?', 'Ileal (Meckel’s) diverticulum', 'Ileocecal valve', 'Hepatopancreatic ampulla', 'Suspensory ligament of duodenum', 'Vermiform appendix', 'E', 'SBA', '2004-12-08', 4, 35),
(2365, 3, 'Which of the following portions of the intestine is truly retroperitoneal  (located posterior to the original parietal peritoneum)?', 'Ascending colon', 'Ascending duodenum', 'Descending colon', 'Duodenal bulb', 'Rectum', 'E', 'SBA', '2004-12-08', 4, 35),
(2366, 4, 'A 75-year-old man has a malignant growth (one cm in diameter) in the intestine which has initially metastasized to both the celiac  and superior mesenteric lymph nodes.  The lesion is most likely located in which of the following regions of the intes', 'Cecum', 'Descending duodenum', 'Left colic flexure', 'Rectum', 'Right colic flexure', 'B', 'SBA', '2004-12-08', 4, 35),
